import React from 'react'

const QuestionList = (props) => {
  return (
    <>
        {
            // document.write(props.questionsList[2])
           props.questionsList.map((question) => (
                <QuestionList question={question} key={QuestionList.id} />
           )) 
        }
    </>
  )
}

export default QuestionList
